import { Route , BrowserRouter as Router} from 'react-router-dom'

const Main = () => {
  return (
        <Router>
      <Switch>
        {/* <Route path="/" exact component={Home} /> */}
        <Route path="/dashboard" component={Dashboard} canActivate={[AuthGuard]} />
        <Route path="/" component={Login} />
      </Switch>
      <ToastContainer />
    </Router>
  )
}

export default Main
